import React from 'react';
import Toolbar from './Toolbar';
import logo from './logo.svg';
import './App.css';
import { createElement } from 'react';

function Home() {

    const QUESTION_URL = "file:///C:/Users/Zacha/Desktop/opencode/frontend/question.html"
    var i

    async function getAllQuestionNames() {
        return fetch("http://localhost:8080/api/v1/question")
          .then(response => response.json().then(function(json) {
            var listOfQuestions = []

            for(i = 0; i < json.length; i++) {
              var li = <li><a href="https://www.youtube.com">asd</a></li>
              listOfQuestions.push(li)
            }

            return listOfQuestions
        }))
    }

    async function populateQuestions() {
        var listOfQuestions = await getAllQuestionNames()
        console.log()
        return <ul>{listOfQuestions}</ul>
    }

    return(
        <>
            <Toolbar />

            <div>
                {populateQuestions()}
            </div>

            <div className="App">
                <header className="App-header">
                    <img src={logo} className="App-logo" alt="logo" />
                    <p>
                    Edit <code>src/App.js</code> and save to reload.
                    </p>
                    <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                    >
                    Learn React
                    </a>
                </header>
            </div>
        </>
    )
}

export default Home;
